import React from "react";
import { Link, useNavigate } from "react-router-dom";

const AdminNavbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("adminToken");
    navigate("/admin/login");
  };

  return (
    <nav className="w-full bg-blue-700 text-white shadow-md px-6 py-4 flex items-center justify-between">
      {/* Logo / Brand */}
      <Link to="/admin/dashboard" className="text-2xl font-bold tracking-wide">
        Admin Panel
      </Link>

      {/* Navigation Links */}
      <div className="hidden md:flex items-center space-x-8 text-lg">
        <Link
          to="/admin/instructors"
          className="hover:text-gray-200 transition"
        >
          Instructors
        </Link>

        <Link to="/admin/courses" className="hover:text-gray-200 transition">
          Courses
        </Link>

        <Link to="/admin/add-course" className="hover:text-gray-200 transition">
          Add Course
        </Link>

        <Link
          to="/admin/add-instructor"
          className="hover:text-gray-200 transition"
        >
          Add Instructor
        </Link>

        <Link
          to="/admin/add-lecture"
          className="hover:text-gray-200 transition"
        >
          Add Lecture
        </Link>
      </div>

      {/* Logout Button */}
      <button
        onClick={handleLogout}
        className="bg-red-500 px-4 py-2 rounded-md hover:bg-red-600 transition text-sm md:text-base"
      >
        Logout
      </button>
    </nav>
  );
};

export default AdminNavbar;
